uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_fov;
uniform float u_camera_dist;
uniform float u_morph;

out vec4 fragColor;

#define MAX_STEPS 100
#define SURF_DIST 0.001
#define MAX_DIST 50.0

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum for organic blending
float smin(float d1, float d2, float k) {
    float h = clamp(0.5 + 0.5 * (d2 - d1) / k, 0.0, 1.0);
    return mix(d2, d1, h) - k * h * (1.0 - h);
}

// Fractal noise for surface detailing
float noise(vec3 p) {
    p *= 0.5;
    float res = 0.0;
    float amp = 0.5;
    for(int i = 0; i < 3; i++) {
        p.xy *= rot(0.5);
        p.yz *= rot(0.3);
        res += amp * abs(sin(p.x + sin(p.y + sin(p.z))));
        amp *= 0.5;
        p *= 2.1;
    }
    return res;
}

// Infinite path for the universe
vec2 getPath(float z) {
    return vec2(
        sin(z * 0.15) * 3.0 + cos(z * 0.08) * 2.0,
        cos(z * 0.12) * 2.5 + sin(z * 0.05) * 1.5
    );
}

// Distance Function
float map(vec3 p) {
    vec2 path = getPath(p.z);
    p.xy -= path; // Universe bending

    // The "Surreal Spine" - Central Structure
    vec3 p1 = p;
    p1.xy *= rot(p.z * 0.2 + iTime * 0.2);

    // Rib-like structures
    float ribs = length(p1.xy + vec2(sin(p1.z * 2.0)*0.5, 0.0)) - 0.4;
    ribs = max(ribs, abs(mod(p1.z, 1.5) - 0.75) - 0.1);

    // Floating Orbs
    vec3 p2 = p;
    p2.z = mod(p2.z, 10.0) - 5.0;
    p2.x += sin(iTime + p.z * 0.1) * 2.0;
    p2.y += cos(iTime * 0.8) * 2.0;
    float orbs = length(p2) - (1.2 + 0.5 * sin(iTime * 2.0 + p.z));

    // Infinite "Veins" / Cables
    vec3 p3 = p;
    p3.xy *= rot(0.78);
    vec2 g = abs(mod(p3.xy, 6.0)) - 3.0;
    float veins = length(g) - 0.1 - noise(p * 0.5) * 0.2;

    // Morphing blend
    float scene = smin(ribs, orbs, 1.5);
    scene = smin(scene, veins, 0.8);

    return scene * 0.6; // Step scaling for detail
}

// Raymarching Loop
float rayMarch(vec3 ro, vec3 rd) {
    float dO = 0.0;
    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * dO;
        float dS = map(p);
        dO += dS;
        if(dO > MAX_DIST || abs(dS) < SURF_DIST) break;
    }
    return dO;
}

// Normal Calculation
vec3 getNormal(vec3 p) {
    float d = map(p);
    vec2 e = vec2(0.01, 0.0);
    vec3 n = d - vec3(
        map(p - e.xyy),
        map(p - e.yxy),
        map(p - e.yyx)
    );
    return normalize(n);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float t = iTime * u_speed;

    // Parallel Rail Camera Logic
    vec3 pathPos = vec3(0.0, 0.0, t);
    pathPos.xy += getPath(pathPos.z);

    // Circular orbit around the central path
    vec2 railVec = vec2(sin(t * 0.2), cos(t * 0.2)) * u_camera_dist;

    vec3 ro = pathPos;
    ro.xy += railVec;

    vec3 ta = vec3(0.0, 0.0, t + 10.0);
    ta.xy += getPath(ta.z) + railVec * 0.5; // Follow the rail's general direction

    // Camera Transform
    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0.0, 1.0, 0.0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f * u_fov + uv.x * r + uv.y * u);

    // Rendering
    float d = rayMarch(ro, rd);
    vec3 col = vec3(0.0);

    if(d < MAX_DIST) {
        vec3 p = ro + rd * d;
        vec3 n = getNormal(p);
        vec3 r_dir = reflect(rd, n);

        // Lighting
        float diffuse = dot(n, normalize(vec3(1, 2, 3))) * 0.5 + 0.5;
        float spec = pow(max(0.0, dot(r_dir, normalize(vec3(1, 2, 3)))), 32.0);
        float fresnel = pow(1.0 - max(0.0, dot(n, -rd)), 5.0);

        // Coloring based on depth and position
        vec3 baseCol = 0.5 + 0.4 * cos(p.z * 0.1 + vec3(0, 2, 4));
        baseCol *= (1.0 - noise(p * 0.1));

        col = baseCol * diffuse;
        col += spec * 0.5;
        col += vec3(0.2, 0.5, 0.9) * fresnel; // Ethereal glow

        // Ambient Occlusion (fake)
        float ao = clamp(map(p + n * 0.5) / 0.5, 0.0, 1.0);
        col *= ao;
    }

    // Volumetric Fog and Background
    float fog = 1.0 - exp(-d * 0.04);
    vec3 skyCol = vec3(0.02, 0.01, 0.05) + 0.05 * vec3(sin(t*0.1), 0.0, cos(t*0.15));
    col = mix(col, skyCol, fog);

    // Post Processing
    col = pow(col, vec3(0.8)); // Gamma
    col *= 1.2 - length(uv) * 0.5; // Vignette

    fragColor = vec4(col, 1.0);
}
